import React, {Component} from 'react';
import './App.css';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";
function App() {
    const particlesInit = async (main) => {
     console.log(main);
      // you can initialize the tsParticles instance (main) here, adding custom shapes or presets
      // this loads the tsparticles package bundle, it's the easiest method for getting everything ready
      // starting from v2 you can add only the features you need reducing the bundle size
      await loadFull(main);
    };

    const particlesLoaded = (container) => {
      console.log(container);
    };
    return (
      <div className=' App'>
      <Particles
        id="tsparticles"
        init={particlesInit}
        loaded={particlesLoaded}
        options={{
            background: {
              color: {
                value: "linear-gradient(-45deg, #ee7752, #e73c7e, #23a6d5, #23d5ab)"
              },
              image: "url('https://particles.js.org/images/background3.jpg')",
              position: "50% 50%",
              repeat: "no-repeat",
              size: "cover"
            },
            backgroundMask: {
              cover: {
                color: {
                  value: {
                    r: '#ee7752',
                    g: '#e73c7e',
                    b: '#23a6d5',
                    a: '#23d5ab'
                  }
                }
              },
              enable: true
            },
            fullScreen: {
              zIndex: -1
            },
            interactivity: {
              events: {
                onClick: {
                  enable: true,
                  mode: "push"
                },
                onHover: {
                  enable: true,
                  mode: "bubble",
                  parallax: {
                    force: 60
                  }
                }
              },
              modes: {
                bubble: {
                  distance: 400,
                  duration: 2,
                  opacity: 1,
                  size: 100,
                  divs: {
                    distance: 200,
                    duration: 0.4,
                    mix: false,
                    selectors: []
                  }
                },
                grab: {
                  distance: 400
                },
                repulse: {
                  divs: {
                    distance: 200,
                    duration: 0.4,
                    factor: 100,
                    speed: 1,
                    maxSpeed: 50,
                    easing: "ease-out-quad",
                    selectors: []
                  }
                }
              }
            },
            particles: {
              color: {
                value: "#ffffff"
              },
              links: {
                color: {
                  value: "#ffffff"
                },
                distance: 150,
                enable: true
              },
              move: {
                attract: {
                  rotate: {
                    x: 600,
                    y: 1200
                  }
                },
                enable: true,
                outModes: {
                  bottom: "out",
                  left: "out",
                  right: "out",
                  top: "out"
                }
              },
              number: {
                density: {
                  enable: true
                },
                value: 80
              },
              opacity: {
                animation: {
                  speed: 1,
                  minimumValue: 0.1
                }
              },
              size: {
                random: {
                  enable: true
                },
                value: {
                  min: 1,
                  max: 30
                },
                animation: {
                  speed: 40,
                  minimumValue: 0.1
                }
              }
            }
          }
        }

      />
        <div className='App'>
    <Navigation />
    <Logo />
    <ImageLinkForm />
    <Rank />
    {/* {<FaceRecognition />
  */}

   </div>
   </div>


  );
}


export default App;
